function CreateGroup(){this.setGroupName=function(a){this.groupName=a};this.getGroupName=function(){return this.groupName};this.ajax=function(){return $.ajax({type:"POST",url:"/groups/AjaxCreateGroup",dataType:"json",data:{groupname:this.getGroupName(),CSRF_SESSION_TOKEN:CSRF_SESSION_TOKEN}})};this.fetch=function(){return this.ajax()}}
function DeleteGroup(a){this.ajax=function(){return $.ajax({type:"POST",url:"/groups/AjaxDeleteGroup",dataType:"json",data:{groupId:a,CSRF_SESSION_TOKEN:CSRF_SESSION_TOKEN}})};this.fetch=function(){return this.ajax()}}function EditGroup(a){var b=null;this.setGroupName=function(a){b=a};this.ajax=function(){return $.ajax({type:"POST",url:"/groups/AjaxEditGroup",dataType:"json",data:{groupId:a,groupName:b,CSRF_SESSION_TOKEN:CSRF_SESSION_TOKEN}})};this.fetch=function(){return this.ajax()}}
function GetGroups(){this.pageNumber=1;this.setPageNumber=function(a){this.pageNumber=a};this.ajax=function(){return $.ajax({type:"POST",url:"/groups/AjaxGetGroups/"+this.pageNumber,dataType:"json",data:{CSRF_SESSION_TOKEN:CSRF_SESSION_TOKEN}})};this.fetch=function(){return this.ajax()}}
function GetUsersInGroup(){this.pageNumber=1;this.role="All";this.groupId=null;this.getPageNumber=function(){return this.pageNumber};this.setPageNumber=function(a){this.pageNumber=a};this.getRole=function(){return this.role};this.setRole=function(a){this.role=a};this.setGroupId=function(a){this.groupId=a};this.ajax=function(){return $.ajax({type:"POST",url:"/groups/AjaxGetUsersInGroup/"+this.getPageNumber(),dataType:"json",data:{role:this.getRole(),groupId:this.groupId,CSRF_SESSION_TOKEN:CSRF_SESSION_TOKEN}})};
this.fetch=function(){return this.ajax()}}function GetAllUsersInGroup(a){this.groupId=a;this.ajax=function(){return $.ajax({type:"POST",url:"/groups/AjaxGetAllUsersInGroup/",dataType:"json",data:{groupId:this.groupId,CSRF_SESSION_TOKEN:CSRF_SESSION_TOKEN}})};this.fetch=function(){return this.ajax()}}
function AddUsersToGroup(){this.groupId=null;this.usersArray=[];this.setGroupId=function(a){this.groupId=a};this.setUsersArray=function(a){this.usersArray=a};this.ajax=function(){return $.ajax({type:"POST",url:"/groups/AjaxAddUserToGroup/",dataType:"json",data:{users:this.usersArray,groupId:this.groupId,CSRF_SESSION_TOKEN:CSRF_SESSION_TOKEN}})};this.fetch=function(){return this.ajax()}}
function RemoveUserFromGroup(){this.userId=this.groupId=null;this.setGroupId=function(a){this.groupId=a};this.setUserId=function(a){this.userId=a};this.ajax=function(){return $.ajax({type:"POST",url:"/groups/AjaxRemoveFromGroup/",dataType:"json",data:{users:this.userId,groupId:this.groupId,CSRF_SESSION_TOKEN:CSRF_SESSION_TOKEN}})};this.fetch=function(){return this.ajax()}};
